import React from 'react';

export default function VehicleHistory(props) {



    if (Object.keys(props.searched).length !== 0) {
        const searchHistory = [];
        searchHistory.push(props.searched);
        console.log(searchHistory);
        return (
            <div>
            <h3>History</h3>
            <hr/>
                {searchHistory.map((data) => {
                    return(
                        <p key={searchHistory.indexOf(data)}>{data.years[0].year} {data.make.name} {data.model.name} {data.engine.name} {data.categories.vehicleStyle}</p>

                    )
                })}
            </div>
        )
    }
}
